import os
import shutil
import zipfile

import requests
from flask import jsonify
import base64
data = ''
mystr = {
    'facebase64': data,
        }


def convert(zipzip):
    with open('output_file.zip', 'wb') as result:
        result.write(base64.b64decode(zipzip))
    zip_ref = zipfile.ZipFile("output_file.zip", 'r')
    zip_ref.extractall("extracted_file")
    zip_ref.close()


url = 'http://24d0-14-240-28-81.ngrok.io/data'
r = requests.post(url, data=mystr)
res = r.json()
zipzip = res["message"]
convert(zipzip)
print(r.status_code)



